import { component$ } from "@builder.io/qwik"
import { NavBar, Footer } from "@nestri/ui"
import { TitleSection, MotionComponent, transition } from "@nestri/ui/react"

//FIXME: Create and pin the Github Issue

export default component$(() => {
    return (

        <>
            <NavBar />
            <TitleSection client:load title="Fundraiser" description="Support Nestri â€” Make cloud gaming accessible to everyone" />
            <MotionComponent
                initial={{ opacity: 0, y: 100 }}
                whileInView={{ opacity: 1, y: 0 }}
                viewport={{ once: true }}
                transition={transition}
                client:load
                class="flex items-center justify-center w-full"
                as="div"
            >
                <div class="flex items-center justify-center w-full pb-20 px-4">
                    <div class="shadow-2xl bg-white dark:bg-black shadow-gray-400 dark:shadow-gray-600 max-w-3xl text-sm w-full mx-auto group overflow-hidden relative">
                        <div class="px-6 sm:px-20 relative pt-12 pb-3 bg-[linear-gradient(180deg,theme(colors.white),theme(colors.gray.100/70%),theme(colors.gray.300/50%))] dark:bg-[linear-gradient(180deg,theme(colors.black),theme(colors.gray.900/70%),theme(colors.gray.700/50%))]">
                            <div class="mb-0">
                                <h3 class="text-lg font-bold font-title pb-4">Dear Cloud Gamer,</h3>
                                <p class="text-sm text-gray-600/70 dark:text-gray-400/70 mb-4">
                                    I'm Wanjohi, the founder of Nestri, and I'm reaching out to share our vision and ask for your support in making it a reality.
                                </p>
                                <p class="text-sm text-gray-600/70 dark:text-gray-400/70">
                                    Nestri was born from a simple yet powerful idea: to make high-end gaming accessible to everyone, regardless of their hardware or location. As a passionate gamer and developer, I've poured my heart and soul into creating <strong>a cloud gaming platform that can deliver AAA gaming experiences for under $5 per user.</strong>
                                </p>
                            </div>
                        </div>
                        <div class="px-6 py-4 text-gray-600/70 dark:text-gray-400/70 sm:px-20 relative bg-[linear-gradient(180deg,theme(colors.white),theme(colors.gray.100/70%)_70%,theme(colors.gray.300/30%))] dark:bg-[linear-gradient(180deg,theme(colors.black),theme(colors.gray.900/70%)_70%,theme(colors.gray.700/50%))]">
                            <div class="rotate-[-0.1deg]">
                                Our journey has been exciting and with its own set of unique challenges. We've tackled technical hurdles, reverse-engineered features, and built a dedicated community. We've also navigated potential litigation over name and copyright issues, and faced accusations of being scammers due to misunderstandings about our development process. These obstacles have been time-consuming and financially draining, but they've only strengthened our resolve.
                            </div>
                            <div class="mt-4 rotate-[-0.1deg]">
                                The financial strain of building Nestri has been significant. We've applied for various funding opportunities, but have faced numerous rejections, making our journey even more challenging. After pouring our resources into development, we're now struggling to cover basic bills and manage accumulating debt. I currently have $3000 in debt that needs to be paid, and I'm in urgent need of a new laptop to continue development.
                                <br />
                                <br />
                                Also working mostly alone (with a lot of help from friends and the open source community) has proven to be slow and tiresome, yet it's a process I've come to cherish. Each line of code, each problem solved, has brought us closer to our vision - even if the pace isn't as fast as we'd like.
                            </div>
                        </div>
                        <div class="px-6 py-4 text-gray-600/70 dark:text-gray-400/70 sm:px-20 relative bg-[linear-gradient(180deg,theme(colors.white),theme(colors.gray.100/70%)_70%,theme(colors.gray.300/50%))] dark:bg-[linear-gradient(180deg,theme(colors.black),theme(colors.gray.900/70%)_70%,theme(colors.gray.700/50%))]">
                            <div class="rotate-[-0.1deg]">
                                Your support can make a world of difference. We're aiming to raise <strong>$50,000</strong>, which will be a game-changer for Nestri. This funding will cover my bills for the next three months, allow me to repay my debts, and bring on a full-time developer to accelerate Nestri's development progress.
                                <br />
                                <br />
                                It will also enable us to rent GPUs essential for launching Nestri, and cover the bandwidth costs to run our cloud gaming platform. Every contribution, no matter the size, brings us closer to our vision  - make high-quality gaming accessible to everyone.
                            </div>
                            <div class="mt-4 rotate-[-0.1deg]">
                                Ready to make a difference? Visit&nbsp;<a href="https://polar.sh/nestri/" class="underline underline-offset-2 text-black dark:text-white" >Polar</a>&nbsp;for more information. Every contribution, big or small, brings us closer to our goal.
                            </div>
                            <div class="mt-4 rotate-[-0.1deg]"> Thank you for supporting Nestri.</div>
                        </div>
                        <div class="px-6 sm:px-20 pb-10 pt-4 bg-white dark:bg-black text-gray-600/70 dark:text-gray-400/70">
                            <div>Gratefully,</div>
                            <div class="mt-3 text-black dark:text-white">
                                <SignatureSVG />
                            </div>
                            <div class="mt-4">P.S. We will get there eventually, but with your help, we could get there sooner.</div>
                        </div>
                    </div>
                </div>
            </MotionComponent>
            <Footer showGH={false} />
        </>
    )
})


